select * from xbrl_taxo_vers
where vers_taxo like '%2016-04-01'

select 0,0,codi_info, orde_info, indi_eeff, indi_situ, indi_resu, indi_fluj, indi_patr, indi_inte, tipo_xml, sche_info, 'S', 1, 'C' from xbrl_info_defi
where codi_info in (select codi_info from xbrl_taxo_info
where vers_taxo like '%2016-04-01')

select distinct ti.codi_info, di.desc_info, di.orde_info, di.sche_info, NULL, tv.vers_taxo
from xbrl_taxo_info ti, xbrl_info_defi di, xbrl_taxo_vers tv	
where ti.vers_taxo like '%2016-04-01%'
and ti.codi_info = di.codi_info	
and tv.vers_taxo = ti.vers_taxo
order by tv.vers_taxo, di.orde_info
	

select distinct 0,0,codi_info, 'es_ES', desc_info, 'C' from xbrl_info_defi		
where codi_info in (select codi_info from xbrl_taxo_info		
where vers_taxo like '%2016-04-01')		
order by codi_info		

select distinct 0,0,codi_info,'C','COME_INDU' from xbrl_taxo_info
where vers_taxo like '%2016-04-01'

select distinct 0,0,codi_info, orde_info, indi_eeff, indi_situ, indi_resu, indi_fluj, indi_patr, indi_inte, tipo_xml, sche_info, 'S', 1, 'D' from xbrl_info_defi
where codi_info in (select ti.codi_info from xbrl_taxo_info ti, xbrl_dime_defi dd
where ti.vers_taxo like '%2016-04-01'
and   ti.codi_info = dd.codi_info)

select distinct 0,0,codi_info, 'es_ES', desc_info, 'D' from xbrl_info_defi						
where codi_info in (select ti.codi_info from xbrl_taxo_info ti, xbrl_dime_defi dd						
					where ti.vers_taxo like '%2016-04-01'	
					and	  ti.codi_info = dd.codi_info)
order by orde_info						

select distinct 0,0,dd.codi_info,'D','COME_INDU' 	
from xbrl_taxo_info ti, xbrl_dime_defi dd	
where ti.vers_taxo like '%2016-04-01'	
and	  ti.codi_info = dd.codi_info


select distinct ic.codi_conc, tipo_conc, tipo_peri, tipo_valo, tipo_cuen, null
from xbrl_defi_conc dc, xbrl_info_conc ic
where ic.codi_info in (
select codi_info from xbrl_taxo_info
where vers_taxo like '%2016-04-01'
and dc.codi_conc = ic.codi_conc)
order by ic.codi_conc

select distinct ic.codi_conc, 'es_ES', desc_conc
from xbrl_defi_conc dc, xbrl_info_conc ic
where ic.codi_info in (select codi_info from xbrl_taxo_info
where vers_taxo like '%2016-04-01')
and dc.codi_conc = ic.codi_conc
order by ic.codi_conc

select distinct 0,0,codi_info, codi_conc, orde_conc, nive_conc, 'C' from xbrl_info_conc
where codi_info in (select codi_info from xbrl_taxo_info
where vers_taxo like '%2016-04-01')
order by codi_info

select distinct codi_info codi_dein, codi_dime, letr_dime, role_uri from xbrl_dime_defi
where codi_info in (select codi_info from xbrl_taxo_info
where vers_taxo like '%2016-04-01')

select distinct * 
from xbrl_dime_axis 
where codi_axis like 'co-sfc-niif-ef-core_2016-04-01.xsd#%'
or codi_axis like 'ifrs-cor_2012-03-29.xsd#%'
or codi_axis like 'ifrs-cor_2013-03-28.xsd#%'

select codi_dime, codi_axis, orde_axis, codi_info codi_dein from xbrl_dime_diax			
where codi_info in (select codi_info from xbrl_taxo_info			
where vers_taxo like '%2016-04-01')			
order by codi_info, codi_dime, orde_axis			

select codi_axis, codi_memb, orde_memb, tipo_memb from xbrl_dime_memb
where codi_info in (select codi_info from xbrl_taxo_info
where vers_taxo like '%2016-04-01')
order by codi_info, codi_memb, orde_memb

select distinct dd.codi_info, ic.codi_conc, ic.orde_conc, dd.codi_dime from xbrl_dime_defi dd, xbrl_info_conc ic						
where dd.codi_info = ic.codi_info						
and	dd.codi_info in (select codi_info from xbrl_taxo_info					
	where vers_taxo like '%2016-04-01')					
and	dd.orde_conc1 <= ic.orde_conc					
and dd.orde_conc2 >= ic.orde_conc						
order by dd.codi_info, codi_dime, ic.orde_conc		

select distinct codi_info codi_dein, codi_dime, 'COME-INDU' from xbrl_dime_defi			
where codi_info in (select codi_info from xbrl_taxo_info			
where vers_taxo like '%2016-04-01')		

select distinct ic.codi_info, ic.codi_cntx	
from	xbrl_info_cntx ic,
		xbrl_taxo_info ti
where	ti.vers_taxo like '%2016-04-01'
and		ti.codi_info = ic.codi_info
	
				


declare @vVersTaxo varchar(256)

declare curTaxo cursor for
	select distinct vers_taxo
	from dbax_taxo_vers
	where vers_taxo like '%2016-04-01'

open curTaxo
fetch next from curTaxo into @vVersTaxo
while @@FETCH_STATUS = 0
begin
	delete from dbax_taxo_conc where vers_taxo = @vVersTaxo
	

	fetch next from curTaxo into @vVersTaxo
end
close curTaxo
deallocate curTaxo